import React from "react";
import { Link } from "react-router-dom";
import "./HomePage.css";

// Importation de l'image banner depuis le dossier src
import bannerImage from "./banner.jpg"; // Image provenant du dossier src

const HomePage = () => {
  return (
    <div className="home-container">
      {/* En-tête avec logo (depuis le dossier public) */}
      <header className="home-header">
        <img src="/logo.png" alt="Logo" className="home-logo" /> {/* Logo dans public */}
        <h1>Bienvenue dans Mon Application</h1>
      </header>

      {/* Bannière avec image (depuis src) */}
      <div
        className="home-banner"
        style={{ backgroundImage: url($,{bannerImage}) }} // Image venant du dossier src
      ></div>

      {/* Section À propos */}
      <section className="home-about">
        <h2>À propos</h2>
        <p>
          Cette application vous permet de visualiser et analyser vos données en temps réel grâce à des tableaux interactifs.
        </p>
      </section>

      {/* Bouton pour accéder à Kibana */}
      <Link to="/kibana">
        <button className="kibana-button">Voir les Tableaux Kibana</button>
      </Link>

      {/* Barre de navigation */}
      <nav className="home-nav">
        <Link to="/">Accueil</Link>
        <Link to="/kibana">Kibana</Link>
        <Link to="/contact">Contact</Link>
      </nav>
    </div>
  );
};

export default HomePage;
